    const localFatBackUser = localStorage.getItem("fatback_user")
    const fatbackUserObject = JSON.parse(localFatBackUser)

    useEffect(() => {
        fetch(`http://localhost:8088/staff?&_expand=user`)
            .then(response => response.json())
            .then(staffInfo => {
                setStaff(staffInfo)
            })
    }, [])

    return (
